import React, { useState, useEffect } from 'react';
import {
  Box,
  Card,
  CardContent,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Alert,
  CircularProgress,
  TextField,
  Grid
} from '@mui/material';
import axios from 'axios';

const UrlStatistics = () => {
  const [urls, setUrls] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [shortcode, setShortcode] = useState('');

  const fetchUrlStats = async (code) => {
    setLoading(true);
    setError('');
    
    try {
      const response = await axios.get(`/shorturls/${code}`);
      const urlData = response.data;
      
      // Add geographical location based on IP (simplified implementation)
      const enhancedClickDetails = urlData.clickDetails.map(click => ({
        ...click,
        location: getLocationFromIP(click.ip)
      }));
      
      const enhancedUrlData = {
        ...urlData,
        clickDetails: enhancedClickDetails,
        isExpired: new Date() > new Date(urlData.expiry)
      };
      
      setUrls([enhancedUrlData]);
    } catch (error) {
      if (error.response?.status === 404) {
        setError('URL not found. Please check the shortcode.');
      } else {
        setError('Failed to fetch URL statistics');
      }
      setUrls([]);
    } finally {
      setLoading(false);
    }
  };

  const getLocationFromIP = (ip) => {
    // Simplified location mapping (in real app, use IP geolocation service)
    const locationMap = {
      '127.0.0.1': 'Localhost',
      '192.168.1.1': 'Local Network',
      '10.1.5.85': 'Local Network',
      'Unknown': 'Unknown Location'
    };
    return locationMap[ip] || 'Unknown Location';
  };

  const handleSearch = () => {
    if (shortcode.trim()) {
      fetchUrlStats(shortcode.trim());
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleString();
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        URL Statistics
      </Typography>
      
      <Card sx={{ mb: 3 }}>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Search URL Statistics
          </Typography>
          <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
            Enter a shortcode to view detailed statistics for that shortened URL.
          </Typography>
          
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={12} sm={8}>
              <TextField
                fullWidth
                label="Enter Shortcode"
                value={shortcode}
                onChange={(e) => setShortcode(e.target.value)}
                placeholder="e.g., lnaBnO_N"
                onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
              />
            </Grid>
            <Grid item xs={12} sm={4}>
              <Button
                variant="contained"
                onClick={handleSearch}
                disabled={!shortcode.trim() || loading}
                fullWidth
              >
                {loading ? 'Searching...' : 'Search'}
              </Button>
            </Grid>
          </Grid>
        </CardContent>
      </Card>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      {loading && (
        <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '200px' }}>
          <CircularProgress />
        </Box>
      )}

      {!loading && urls.length === 0 && !error && (
        <Card>
          <CardContent>
            <Typography variant="h6" textAlign="center" color="text.secondary">
              No URL Statistics Found
            </Typography>
            <Typography variant="body2" textAlign="center" color="text.secondary">
              Enter a shortcode above to view detailed statistics for a shortened URL
            </Typography>
          </CardContent>
        </Card>
      )}

      {urls.map((url, index) => (
        <Card key={url.shortcode} sx={{ mb: 3 }}>
          <CardContent>
            <Typography variant="h6" gutterBottom>
              Shortcode: {url.shortcode}
            </Typography>
            
            <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
              Original URL: {url.originalUrl}
            </Typography>
            
            <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
              Short Link: {url.shortLink}
            </Typography>
            
            <Typography variant="body2" sx={{ mb: 1 }}>
              Created: {formatDate(url.createdAt)}
            </Typography>
            
            <Typography variant="body2" sx={{ mb: 1 }}>
              Expires: {formatDate(url.expiry)}
            </Typography>
            
            <Typography variant="body2" sx={{ mb: 1 }}>
              Status: {url.isExpired ? 'Expired' : 'Active'}
            </Typography>
            
            <Typography variant="body2" sx={{ mb: 2 }}>
              Total Clicks: {url.totalClicks}
            </Typography>

            <Typography variant="h6" gutterBottom>
              Click Details
            </Typography>
            
            {url.clickDetails.length === 0 ? (
              <Typography variant="body2" color="text.secondary">
                No clicks recorded yet
              </Typography>
            ) : (
              <TableContainer component={Paper} variant="outlined">
                <Table size="small">
                  <TableHead>
                    <TableRow>
                      <TableCell>Timestamp</TableCell>
                      <TableCell>Referrer</TableCell>
                      <TableCell>User Agent</TableCell>
                      <TableCell>IP Address</TableCell>
                      <TableCell>Location</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {url.clickDetails.map((click, clickIndex) => (
                      <TableRow key={clickIndex}>
                        <TableCell>
                          {formatDate(click.timestamp)}
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2" sx={{ maxWidth: 200, wordBreak: 'break-all' }}>
                            {click.referrer}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2" sx={{ maxWidth: 300, wordBreak: 'break-all' }}>
                            {click.userAgent}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2" fontFamily="monospace">
                            {click.ip}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2">
                            {click.location}
                          </Typography>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            )}
          </CardContent>
        </Card>
      ))}
    </Box>
  );
};

export default UrlStatistics;
